import { defineStore } from 'pinia';

export const LoginStore = defineStore({
  id: 'userLogin',
  state: () => ({
    userLogin: -1,
    nomeUtilizador:"",
    idUtilizador:""
  }),
  actions: {
    setUserLogin(userLogin) {
      this.userLogin = userLogin;
    },
    setNomeUtilizador(nome_utiliador){
      this.nomeUtilizador=nome_utiliador;
    }
  },
  getters: {
    getUserLogin() {
      return this.userLogin;
    },
    getName() {
      return 'Diogo Venâncio';
    },
    getNomeUtilizador(){
      return this.nomeUtilizador;
    }
  },
});
